cl-list* is a compiled Lisp function in `cl-lib.el'.<br/><br/>(cl-list* ARG...)<br/><br/>This function has a compiler macro.<br/><br/>Return a new list with specified ARGs as elements, consed to last ARG.<br/>Thus, `(cl-list* A B C D)' is equivalent to `(nconc (list A B C) D)', or to<br/>`(cons A (cons B (cons C D)))'.
